var station = "Distribution_80";
var variableClass = "";

for (let key in variables) {
    if (variables.hasOwnProperty(key)) {
        if (key.includes("I_")) variableClass = "Actuators";
        if (key.includes("O_")) variableClass = "Sensors";
        if (key.includes("F_")) variableClass = "Feedback";
